import './Profile.css';
import './style.css';

export default function Toggles({ currentCat, setCurrentCat, allCategories }) {
 
  return (
    <>
      <div className="toggles">
        {allCategories.map((catname) => {
          return (
            <button
              className={"toggle " + catname === currentCat ? "selected-cat-button" : "default-cat-button"}
              onClick={() => setCurrentCat(catname)}
              key={catname}
            >
              {catname}
            </button>
          );
        })}
      
      </div>
    </>
  );
}
